import React from "react";
import "./header.css";
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <div className="header">
      <h1>BIENVENIDO A POCRATECH</h1>
      <Link to="/pokemon/:userId">Mis Pokemos</Link>
    </div>
  );
}
